                <th>Image</th>
                <th>Prix</th>
                <th>Status</th>
                <th>Nomber des personne</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for room in rooms %}
            <tr>
                <td>{{ room.id }}</td>
                <td>{{ room.title }}</td>
                <td>{{ room.hotelid }}</td>
                <td>{{ room.description }}</td>
                <td>{{ room.image }}</td>
                <td>{{ room.price }}</td>
                <td>{{ room.status }}</td>
                <td>{{ room.number }}</td>
                <td>
