                    <a href=\"{{ path('admin_room_edit', {'id': room.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"9\">Pas resultat</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('admin_room_new') }}\"> Création</a>
{% endblock %}
